import React, { useState, useEffect } from "react";
import {
  HomeIcon,
  UserIcon,
  ChatBubbleLeftIcon,
  ClipboardDocumentListIcon,
  MagnifyingGlassIcon,
  WalletIcon,
  ReceiptRefundIcon,
  ChatBubbleOvalLeftIcon,
  ArrowRightOnRectangleIcon,
  BellIcon,
  Bars3Icon,
  XMarkIcon,
  BookmarkIcon,
} from "@heroicons/react/24/outline";
import { useNavigate } from 'react-router-dom';
import { getUserBookings, updateTransactionStatus } from '../../../services/api';

function ConfirmPayment({ booking, onClose, onConfirm }) {
  return (
    <div className="fixed inset-0 bg-black/60 backdrop-blur-sm flex items-center justify-center z-50">
      <div className="bg-white rounded-2xl shadow-xl w-[85%] max-w-sm m-4">
        <div className="p-4 border-b flex justify-between items-center">
          <h2 className="text-base font-semibold text-gray-900">Confirm Payment</h2>
          <button onClick={onClose} className="p-1 hover:bg-gray-100 rounded-full transition-colors">
            <XMarkIcon className="h-5 w-5 text-gray-500" />
          </button>
        </div>

        <div className="p-4 space-y-4">
          <div className="flex justify-between text-sm">
            <span className="text-gray-600">Service:</span>
            <span className="font-medium">{booking.title}</span>
          </div>
          <div className="flex justify-between text-sm">
            <span className="text-gray-600">Provider:</span>
            <span className="font-medium">{booking.providerName}</span>
          </div>
          <div className="flex justify-between text-sm">
            <span className="text-gray-600">Price:</span>
            <span className="font-medium">{booking.price} SkillCoins</span>
          </div>
          <hr />
          <div className="space-y-2 pt-2">
            <button
              onClick={() => onConfirm(booking.id)}
              className="w-full bg-gradient-to-r from-blue-600 to-indigo-600 text-white py-2.5 rounded-xl text-sm font-medium hover:from-blue-700 hover:to-indigo-700 transition-all"
            >
              Confirm Payment
            </button>
            <button
              className="w-full py-2.5 text-sm font-medium text-gray-600 hover:bg-gray-50 rounded-xl transition-all"
              onClick={onClose}
            >
              Cancel
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default function Transaction() {
  const navigate = useNavigate();
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);
  const [showConfirmModal, setShowConfirmModal] = useState(false);
  const [bookings, setBookings] = useState([]);
  const [selectedBooking, setSelectedBooking] = useState(null);

  const navItems = [
    { name: "Home", icon: <HomeIcon className="h-5 w-5" />, path: "/dashboard" },
    { name: "Profile", icon: <UserIcon className="h-5 w-5" />, path: "/profile" },
    { name: "Messages", icon: <ChatBubbleLeftIcon className="h-5 w-5" />, path: "/messages" },
    { name: "My Services", icon: <ClipboardDocumentListIcon className="h-5 w-5" />, path: "/my-services" },
    { name: "Find Services", icon: <MagnifyingGlassIcon className="h-5 w-5" />, path: "/find-services" },
    { name: "Saved", icon: <BookmarkIcon className="h-5 w-5" />, path: "/saved" },
    { name: "Wallet", icon: <WalletIcon className="h-5 w-5" />, path: "/wallet" },
    { name: "Transactions", icon: <ReceiptRefundIcon className="h-5 w-5" />, path: "/transactions" },
    { name: "Feedback", icon: <ChatBubbleOvalLeftIcon className="h-5 w-5" />, path: "/feedback" },
    { name: "Log Out", icon: <ArrowRightOnRectangleIcon className="h-5 w-5" />, path: "/" },
  ];

  useEffect(() => {
    fetchUserBookings();
  }, []);

  const fetchUserBookings = async () => {
    try {
      const user = JSON.parse(localStorage.getItem('user'));
      const response = await getUserBookings(user.id);
      setBookings(response.data);
    } catch (error) {
      console.error('Error fetching bookings:', error);
    }
  };

  const completeBooking = async (bookingId) => {
    try {
      await updateTransactionStatus(bookingId, 'completed');
      setShowConfirmModal(false);
      fetchUserBookings();
      alert('Booking completed!');
    } catch (error) {
      console.error(error);
      alert('Failed to complete booking');
    }
  };

  const renderBooking = (booking) => (
    <div key={booking.id} className={`border rounded-lg p-4 shadow-sm bg-white mb-3`}>
      <div className="flex justify-between items-start mb-2">
        <div>
          <h3 className="font-semibold">{booking.title}</h3>
          {booking.status === 'ongoing' && (
            <span className="text-xs text-blue-600 font-medium">Ongoing</span>
          )}
        </div>
        <p className="font-semibold">SC {booking.price}</p>
      </div>
      <p className="text-gray-500 text-sm mb-3">{booking.description}</p>
      <div className="flex items-center justify-between">
        <div className="flex items-center space-x-2">
          <span className={`flex items-center text-xs px-2 py-1 rounded-full ${
            booking.status === 'ongoing'
              ? 'bg-blue-100 text-blue-700'
              : 'bg-green-100 text-green-700'
          }`}>
            <span className={`w-2 h-2 mr-1 rounded-full ${
              booking.status === 'ongoing' ? 'bg-blue-500' : 'bg-green-500'
            }`}></span>
            {booking.status}
          </span>
        </div>
        {booking.status === 'ongoing' && (
          <button
            onClick={() => { setSelectedBooking(booking); setShowConfirmModal(true); }}
            className="text-sm text-blue-600 hover:text-blue-700"
          >
            Complete Booking
          </button>
        )}
      </div>
    </div>
  );

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-50 to-white flex flex-col w-full md:max-w-sm mx-auto relative">
      {/* Header */}
      <div className="p-6 bg-gradient-to-r from-blue-600 to-indigo-600 text-white flex items-center justify-between">
        <button onClick={() => setIsSidebarOpen(true)}>
          <Bars3Icon className="h-6 w-6 text-white" />
        </button>
        <h1 className="text-lg font-semibold">Transactions</h1>
        <button onClick={() => navigate('/notification')} className="relative">
          <BellIcon className="h-6 w-6 text-white" />
        </button>
      </div>

      {/* Content */}
      <div className="flex-1 p-4 overflow-y-auto">
        <h2 className="text-gray-600 text-sm font-medium mb-2">Current Transactions</h2>
        {bookings.filter(b => b.status === 'ongoing').length > 0 ? 
          bookings.filter(b => b.status === 'ongoing').map(renderBooking) : 
          <p className="text-center text-gray-500 py-6 bg-gray-50 rounded-xl">No ongoing transactions</p>
        }

        <h2 className="text-gray-600 text-sm font-medium mb-2 mt-6">Past Transactions</h2>
        {bookings.filter(b => b.status === 'completed').map(renderBooking)}
      </div>

      {showConfirmModal && selectedBooking && (
        <ConfirmPayment
          booking={selectedBooking}
          onClose={() => setShowConfirmModal(false)}
          onConfirm={completeBooking}
        />
      )}
    </div>
  );
}
